package ListRelated;

import java.util.Arrays;
import java.util.HashMap;
import java.util.Map;

/**
 * @author 冼家荣 xianjr1 xianjr1@meicloud.com
 * @Date 2020/3/23 10:54
 * 求异位词
 */
public class IsAnagram {

    public static void main(String[] args) {

        String s = "";
        String t = "";

        System.out.println(isAnagramOp(s, t));

    }

    public static boolean isAnagramOp(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        }
        // 使用同一个计数器
        Map<Character, Integer> tmpMap = new HashMap<>();
        char[] chars1 = s.toCharArray();
        char[] chars2 = t.toCharArray();
        for (char c : chars1) {
            if (tmpMap.containsKey(c)) {
                Integer integer = tmpMap.get(c);
                tmpMap.put(c, ++integer);
            } else {
                tmpMap.put(c, 1);
            }
        }
        for (char c : chars2) {
            if (tmpMap.containsKey(c)) {
                Integer integer = tmpMap.get(c);
                tmpMap.put(c, --integer);
            }
        }
        for (Map.Entry<Character, Integer> entry : tmpMap.entrySet()) {
            if (!entry.getValue().equals(0)) {
                return false;
            }
        }
        return true;
    }

    public boolean isAnagramForJava(String s, String t) {
        char[] sChars = s.toCharArray();
        char[] tChars = t.toCharArray();
        Arrays.sort(sChars);
        Arrays.sort(tChars);
        return String.valueOf(sChars).equals(String.valueOf(tChars));
    }


    /**
     * 使用计数器计算
     * 优化: 使用同一个计数器即可, 第一次计数器计算频率, 第二次计数器减少, 最终判断计数器是否归零
     *
     * @param s
     * @param t
     * @return
     */
    public static boolean isAnagram(String s, String t) {
        // 1. 计算字符串1 和 字符串2 中每个字母出现的次数
        Map<Character, Integer> tmpMap1 = new HashMap<>();
        Map<Character, Integer> tmpMap2 = new HashMap<>();

        char[] charArray1 = s.toCharArray();
        char[] charArray2 = t.toCharArray();

        confirmMap(tmpMap1, charArray1);

        confirmMap(tmpMap2, charArray2);

        // 判断tmpMap1 和 tmpMap2 是否相同
        Boolean flag = true;
        if (tmpMap1.size() != tmpMap2.size()) {
            return false;
        }
        for (Map.Entry<Character, Integer> entrySet : tmpMap1.entrySet()) {
            Character key = entrySet.getKey();
            if (tmpMap2.get(key) == null || !tmpMap2.get(key).equals(tmpMap1.get(key))) {
                return false;
            }
        }
        return flag;
    }

    private static void confirmMap(Map<Character, Integer> tmpMap2, char[] charArray2) {
        for (char c : charArray2) {
            if (tmpMap2.containsKey(c)) {
                Integer count = tmpMap2.get(c);
                tmpMap2.put(c, ++count);
            } else {
                tmpMap2.put(c, 1);
            }
        }
    }


}
